家庭用らくらくシャッター開閉　楽々シャッター開閉器　<br><table width="600" border="0" cellspacing="0" cellpadding="0"> <tr> <td><table width="600" border="0" cellspacing="0" cellpadding="5"> <tr> <td bgcolor="#999999"><font color="#FFFFFF" size="5"><strong>家庭用らくらくシャッター開閉器　シャ楽　SKK-H16G7A</strong></font><br /> <font color="#FFFFFF">家庭用シャッター開閉器　写楽　シャラク　SKKH16G7A</font></td> </tr> </table> <br /></td> </tr> <tr> <td align="center"><img src="http://image.rakuten.co.jp/esteyou/cabinet/wat-03/wat3735-01.jpg" border="0" /><br /><br />ガレージのシャッターの開閉は、荷物があったり、雨の日には厄介なものです。<br />古くなって開閉に力が必要なものは、爪や手首や腰を痛めることがあります。<br />家庭用らくらくシャッター開閉器『シャ楽』は、取付簡単、片手で簡単に開け閉めできます。<br /><br /><table width="500" align="center"><tr><td><iframe src="http://www.rakuten.ne.jp/gold/matsucame/flv/wat3735movie.html" width="480" height="360" scrolling="no" frameborder="0"></iframe></td></tr></table><br /><br /><table width="600" border="0" cellspacing="0" cellpadding="5"> <tr> <td><img src="http://image.rakuten.co.jp/esteyou/cabinet/wat-03/wat3735-02.jpg" border="0" /><br />据付けタイプですので置き場所をとりません。</td> <td><img src="http://image.rakuten.co.jp/esteyou/cabinet/wat-03/wat3735-03.jpg" border="0" /><br />女性やお年寄りの方でも片手で簡単に開け閉めできます。</td> </tr></table><img src="http://image.rakuten.co.jp/esteyou/cabinet/wat-03/wat3735-04.gif" border="0" /><br /><br /></td> </tr><tr> <td><table width="560" border="1" cellspacing="0" cellpadding="10" bordercolor="#663300"> <tr> <td><font size="2" face="ＭＳ ゴシック, MS Gothic, Osaka－等幅, Osaka-mono, monospace"><font color="#663300"><strong>取り付けるだけで、シャッターの開け閉めをもっと楽に</strong></font><br /><br />■重いシャッターの開け閉めがラクラク！爪や手首を痛めません。<br />■女性やお年寄りでも片手で簡単に開け閉めできます。<br />■据付タイプですので置き場所をとりません。</font></td> </tr> </table> <br /> <br /></td> </tr> <tr> <td><table bgcolor="#666666" cellspacing="1" cellpadding="3" width="80%"><tr><td bgcolor="#ffffff" colspan="2" align="center" ><font size="2">シャ楽　SKK-H16G7A</font></td></tr><tr bgcolor="#ffffff"><td width="20%"><font size="2">本体サイズ</font></td><td width="80%"><font size="2">約W370×D120mm</font></td></tr><tr bgcolor="#ffffff"><td width="20%"><font size="2">材質</font></td><td width="80%"><font size="2">鉄(静電塗装)</font></td></tr><tr bgcolor="#ffffff"><td width="20%"><font size="2">ご使用方法</font></td><td width="80%"><font size="2">1.取り付け方法に従い正しく取り付けされていることを確認してください。<br />2.シャッターを開ける時は、取っ手を持ちシャッターを垂直に引き上げてください。<br />"シャ楽"には、取っ手の部分にローラーがついていますのでガレージの上方にひさし部分や突起物がある場合は、ローラーの動きで、"シャ楽"は前方に倒れるように設計していますので、ゆっくり引き上げてください。<br />3.引き上げた状態では、"シャ楽"は、地面に対して水平に近い上向きになるようにバネを調整してあります。<br />車庫が高すぎて"シャ楽"のハンドルに直接手が届かない時は、取っ手の中央部分に1本の軽い紐を付けハンドルを届く位置まで下げてからハンドルを持って引き下げてください。</font></td></tr><tr bgcolor="#ffffff"><td width="20%"><font size="2">区分</font></td><td width="80%"><font size="2">雑貨　工具　便利グッズ</font></td></tr><tr bgcolor="#ffffff"><td width="20%"><font size="2">広告文責</font></td><td width="80%"><font size="2">株式会社マツムラカメラ　076-242-1122</font></td></tr></table><br /><br /></td> </tr> <tr> <td><img src="http://image.rakuten.co.jp/esteyou/cabinet/wat-03/wat3735-00.jpg" width="250" border="0" /></td> </tr></table><!--siyokan--><br><br><table width="250" border="0"><tr><td><font size="2">※使用感には個人差がございます。</font></td></tr></table><!--siyokan_end--><br><br><img src="http://image.rakuten.co.jp/esteyou/cabinet/img-2/pre2.gif"><br><br><br><img src="http://www.rakuten.ne.jp/gold/matsucame/pic_data/koshihikari.jpg"><br><br><font color="#ff0000" size="2">※おまけはお一人様につき１点となります</font><br><br><table width="400" border="1" cellspacing="0" cellpadding="3"> <tr> <td height="32"><font size="2">通販　口コミ　クチコミ　レビュー<br /><a style="text-decoration:none" href="http://item.rakuten.co.jp/matsucame/wat3735/"><font color="#000000">家庭用らくらくシャッター開閉器　シャ楽　SKK-H16G7A</font></a></font></td> </tr></table><br />　<br>家庭用ラクラクシャッター開閉器 シャラク　<br>送料無料　（沖縄や離島や僻地は送料別途かかります）<br><br><a href="http://my.bookmark.rakuten.co.jp/?func=reg&amp;svid=101&amp;shop_bid=205798&amp;iid=10056307&amp;itype=1" target="_blank"><img src="http://image.rakuten.co.jp/nihonnett/cabinet/001/okiniiri.gif" width="700" height="60" border="0"></a><br><br>